import React from "react";
import { Table } from 'reactstrap';


const WorkoutWeekTable = ({workouts}) => {

    const tableStyle = {
        height: '100%',
        marginTop: '50px'
    };

    const tableDataStyle = {
        margin: '-30px'
    }

    return (
        <Table bordered responsive style={tableStyle}>
            <thead>
            <tr>
                <th>Mo</th>
                <th>Tu</th>
                <th>We</th>
                <th>Th</th>
                <th>Fr</th>
                <th>Sa</th>
                <th>Su</th>
            </tr>
            </thead>
            <tbody>
            <tr>
                {workouts.map(workout => <td key={ workout.id }> {workout.name} </td>)}
            </tr>
            <tr style={{"line-height": "100px"}}>
                {workouts.map(workout =>
                    <td key={ workout.id }>
                        <ul>
                            {workout.exercises.map(exercise => <li style={tableDataStyle}>{exercise.name}</li>)}
                        </ul>
                    </td>)}

            </tr>
            </tbody>
        </Table>

    )
}

export default WorkoutWeekTable;


